@Override
public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result
      + (int) (estimatedMergeBytes ^ (estimatedMergeBytes >>> 32));
  result = prime * result + (isExternal ? 1231 : 1237);
  result = prime * result + mergeMaxNumSegments;
  result = prime * result + totalDocCount;
  return result;
}

